import React from "react";
import './Initiatives.css';

import Box from '@mui/material/Box';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';

class InitiativeCard {

}

export default class Initiatives extends React.Component {
    state = {
        posts: []
    }

    componentDidMount = () => {
    };

    render() {
        return (
            <>
            <h1 className = "h1"> <center> Our Initiatives </center> </h1>
            <h2 className = "h2">
                <center>
                We take pride in the freedom our members have to pursue impactful initiatives both immediately and in the long term.
                Some initiatives have been around for a decade or more, while others come and go as our goals evolve.
                Check out what we've been working on!
                </center>
            </h2>

            <Card sx={{ minWidth: 275 }}>
            <CardContent>
                <Typography sx={{ fontSize: 14 }} color="text.secondary" gutterBottom>
                    Resources
                </Typography>
                <Typography variant="h5" component="div">
                    CS 193
                </Typography>
                <Typography sx={{ mb: 1.5 }} color="text.secondary">
                    Tools course taught by USB members
                </Typography>
                <Typography variant="body2">
                    Leads: 
                    <br />
                </Typography>
            </CardContent>
            <CardActions>
                <Button size="small">Learn More</Button>
            </CardActions>
            </Card>
            </>
        );
    }
}
